func writeStaticFiles() error {
	// create and write bootstrap.min.css
	bootstrapFile, err := os.Create("bootstrap.min.css")
	if err != nil {
		return err
	}
	_, err = bootstrapFile.Write([]byte(staticBootstrapCss))
	if err != nil {
		return err
	}

	// create and write style.css
	styleFile, err := os.Create("style.css")
	if err != nil {
		return err
	}
	_, err = styleFile.Write([]byte(staticStyleCss))
	if err != nil {
		return err
	}

	// create and write glyphicons-halflings.png
	glyphiconsHalflingsFile, err := os.Create("glyphicons-halflings.png")
	if err != nil {
		return err
	}
	_, err = glyphiconsHalflingsFile.Write(staticGlyphiconsHalflings)
	if err != nil {
		return err
	}

	// create and write glyphicons-halflings-white.png
	glyphiconsHalflingsWhiteFile, err := os.Create("glyphicons-halflings-white.png")
	if err != nil {
		return err
	}
	_, err = glyphiconsHalflingsWhiteFile.Write(staticGlyphiconsHalflingsWhite)
	if err != nil {
		return err
	}

	return nil
}

